import { gql } from '@apollo/client';

export const getEvent = gql`
query getEvent($id: ID!){
    event(id:$id){
        id
      title
      desc
      date
      location{
        name
        desc
        lat
        lng
      }
      participants{
        user{
          username
          email
        }
      }
    }
  }
`;
